{
  "name": "im-chat-client",
  "version": "1.0.0",
  "description": "Vue 3 frontend for IM chat demo",
  "type": "module",
  "scripts": {
    "dev": "vite",
    "build": "vue-tsc && vite build",
    "preview": "vite preview"

        "tw:watch": "tailwindcss -i ./src/assets/tailwind.css -o ./src/assets/tw-output.css --watch",
